let nations = shuffle(["Andorra", "Austria", "Belgio", "Bulgaria", "Repubblica ceca", "Germania", "Danimarca", "Estonia", "Finlandia", "Grecia", "Croazia", "Ungaria", "Irlanda", "Islanda", "Italia", "Liechtenstein", "Lituania", "Lussemburgo", "Lettonia", "Moldova", "Polonia", "Portogallo", "Romania", "Slovacchia", "Slovenia", "Svezia", "Olanda", "Spagna", "Francia", "Portogallo"])
    
function NationSlider() {
    let nationSlider = useRef(null)
    const [currentIndex, changeIndex] = useState(0)
    function scroll(amount) {
        let nationSliderEl = nationSlider.current
        let offset = currentIndex + amount
        let nationElements = nationSliderEl.children
        if (offset > nations.length - 1 || offset < 0) return
        nationElements[offset].scrollIntoView({behavior: "smooth", block: "nearest"})
        changeIndex(offset)
    }

    return (
        <div className="nationSliderWrapper" >
            <div className="nationSlider" ref={nationSlider} >
                {nations.map(nation => {
                    return <Nation>{nation}</Nation>
                })}
            </div>
            <div className="arrowContainer">
                <Arrow pos="left" scroll={scroll} visible={currentIndex > 0}/>
                
                <Arrow pos="right" scroll={scroll} visible={currentIndex < nations.length - 1}/>
            </div>

        </div>
    )
}

function Arrow(props) {

    let rotate = `rotate(${props.pos === "left" ? 180 : 0}deg)`
    let amount = props.pos === "left" ? -1 : 1
    return <button 
            className="arrow" 
            onClick={() => props.scroll(amount)}
            style={{visibility: props.visible ? "visible" : "hidden"}}
        >
        <img
            style={{ transform: rotate }}
            src={arrow}
        />
    </button>
}
function Nation(props) {
    return (
        <a 
            
            className="nationWrapper" 
            href={"https://it.wikipedia.org/wiki/"+props.children} 
            key={props.children}
        >
            <div className="nationName">
                {props.children}
            </div>
            <svg width="193" height="215" fill="#ffcc00">
                {getSvg(props.children)}
            </svg>
        </a>
    )
}


